import React, { useState } from 'react';
import { useParams, useLocation, useNavigate } from 'react-router-dom';
import { Calendar } from 'lucide-react';
import './BookNow.css';

function BookNow() {
  const { id } = useParams();
  const location = useLocation();
  const navigate = useNavigate();
  const roomDetails = location.state?.roomDetails;

  const [bookingData, setBookingData] = useState({
    checkIn: '',
    checkOut: '',
    guests: 1,
    specialRequests: '',
  });

  if (!roomDetails) {
    navigate('/');
    return null;
  }

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setBookingData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Booking submitted:', { roomId: id, ...bookingData });
    alert('Booking submitted successfully!');
    navigate('/');
  };

  return (
    <div className="book-now-page">
      <div className="book-now-container">
        <div className="book-now-header">
          <h2>Book Your Stay</h2>
          <p>Please fill in the details to complete your booking for {roomDetails.title}.</p>
        </div>
        <div className="book-now-content">
          <img src={roomDetails.image} alt={roomDetails.title} className="room-image" />
          <div className="room-details">
            <div className="room-info">
              <h3>{roomDetails.title}</h3>
              <p>Price: Rs {roomDetails.price.toLocaleString()}/month</p>
              <p>{roomDetails.furnished ? 'Furnished' : 'Unfurnished'}</p>
            </div>
            <div className="amenities">
              <h4>Amenities:</h4>
              <ul>
                {roomDetails.amenities.parking && <li>Parking</li>}
                {roomDetails.amenities.wifi && <li>WiFi</li>}
                {roomDetails.amenities.water && <li>Water</li>}
              </ul>
            </div>
          </div>
          <form onSubmit={handleSubmit} className="booking-form">
            <div className="form-group">
              <label htmlFor="checkIn">Check-in Date</label>
              <div className="date-input-wrapper">
                <Calendar className="calendar-icon" size={18} />
                <input
                  type="date"
                  id="checkIn"
                  name="checkIn"
                  value={bookingData.checkIn}
                  onChange={handleInputChange}
                  required
                />
              </div>
            </div>
            <div className="form-group">
              <label htmlFor="checkOut">Check-out Date</label>
              <div className="date-input-wrapper">
                <Calendar className="calendar-icon" size={18} />
                <input
                  type="date"
                  id="checkOut"
                  name="checkOut"
                  value={bookingData.checkOut}
                  onChange={handleInputChange}
                  required
                />
              </div>
            </div>
            <div className="form-group">
              <label htmlFor="guests">Number of Guests</label>
              <input
                type="number"
                id="guests"
                name="guests"
                min="1"
                value={bookingData.guests}
                onChange={handleInputChange}
                required
              />
            </div>
            <div className="form-group">
              <label htmlFor="specialRequests">Special Requests</label>
              <textarea
                id="specialRequests"
                name="specialRequests"
                rows={3}
                value={bookingData.specialRequests}
                onChange={handleInputChange}
              ></textarea>
            </div>
            <button type="submit" className="submit-button">
              Confirm Booking
            </button>
          </form>
        </div>
      </div>
    </div>
  );
}

export default BookNow;
